import React, { Component } from 'react';
import './App.css';
import UserForm from './Components/UserForm';
import Footer from './Components/Footer'
import Header from './Components/Header';

class App extends Component {

  render() {
    return (
      <div className="App">
        <Header />
        <UserForm />
        <Footer />
      </div>
    );

  }
}

export default App;
